            {peopleData.map(item => {
                return  <div key={item.index}>
                    name: {item.name}
                </div>
            })}
        </div>
        <div>
            {planetData.map(item => {
                return  <div key={item.index}>
                    name: {item.name}
                </div>
            })}
        </div>
        </div>
    );
}

